import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import { useHistory } from 'react-router-dom';


function FrontPage({user_cpu, user_gpu, user_ram, game_name, onChange}) {
    const history = useHistory();

    const handleSubmit = (e) => {
        e.preventDefault();
        history.push("/result");
    };

    const [cpuSuggestions, setCpuSuggestions] = useState([]);
    const [gpuSuggestions, setGpuSuggestions] = useState([]);

    const fetchSuggestions = async (input, type) => {
        try {
          const response = await axios.get(`/api/suggestions?input=${input}&type=${type}`);
          if (type === 'cpu') {
            setCpuSuggestions(response.data);
          } else if (type === 'gpu') {
            setGpuSuggestions(response.data);
          }
        } catch (error) {
          console.error('Failed to fetch suggestions:', error);
        }
      };

      useEffect(() => {
        if (user_cpu) fetchSuggestions(user_cpu, 'cpu');
      }, [user_cpu]);

      useEffect(() => {
        if (user_gpu) fetchSuggestions(user_gpu, 'gpu');
      }, [user_gpu]);

  let id = "inputs";
  return (
        <div id={id}>
            <form onSubmit={handleSubmit}>
            <label htmlFor='game_name'>Game</label><br/>
            <input
                type='text'
                id='game_name'
                name='game_name'
                placeholder='Enter Name of the Game here'
                value={game_name}
                onChange= {onChange}
            />
            <br/>
            <label htmlFor='user_cpu'>User CPU</label><br/>
                <input
                type='text'
                id='user_cpu'
                name='user_cpu'
                placeholder='Enter your CPU here'
                value={user_cpu}
                onChange={onChange}
                />
                <div>
                {cpuSuggestions.map((suggestion, index) => (
                    <div key={index}>{suggestion.model}</div>
                ))}
                </div>
            <br/>
            <label htmlFor='user_gpu'>User GPU</label><br/>
            <input
                type='text'
                id='user_gpu'
                name='user_gpu'
                placeholder='Enter your GPU here'
                value={user_gpu}
                onChange= {onChange}
            />
            <br/>
            <label htmlFor='user_ram'>User RAM</label><br/>
            <input
                type='text'
                id='user_ram'
                name='user_ram'
                placeholder='Enter your RAM here'
                value={user_ram}
                onChange= {onChange}
            />
            <br/>
            <input type="submit" value="Submit" />
          </form>
        </div>
  );
}

export default FrontPage;
